PowerArchiver - earlier named EasyZip,  
is a beautiful facility for work with archive.  
The Built-in base supports the majority existing format:  
ZIP,  
CAB, 
LHA (LZH), 
TAR (+TAR.GZ), 
BH (BlackHole),  
RAR, 
ARJ, 
ARC, 
ACE, 
ZOO, 
Gzip.
